$_MODULE['<{paytpv}prestashop>paytpv-account_0016fb206147ce40e0b0c047777279f9'] = ' Wszystkie  informacje o transakcjach są przesyłane między stroną i systemem PAYTPV oraz są szyfrowane za pomocą certyfikatów SSL 256-bitowego. Dane posiadacza są przesyłane zaszyfrowane i wszystkie e-maile wysyłane do serwerów z PAYTPV są podpisane za pomocą  hashing SHA w celu zapobiegania manipulacjom. Informacje, które są przesyłane do serwerów PAYTPV nie można przeglądać, skanować, używać ani modyfikować przez osoby z zewnątrz, które uzyskują dostęp do poufnych informacji. ';
