$_MODULE['<{paytpv}prestashop>paytpv-account_34b967476a10ad43bc22b673edba98b4'] = 'W systemie PAYTPV, poufne informacje są chronione za pomocą standardów szyfrowania 1024-bitowych. Klucze szyfrujące są przechowywane w systemach o wysokim poziomie bezpieczeństwa o podwójnym uwierzytelnieniu co uniemożliwia ich wydobycie. Banki, organizacje bezpieczeństwa i audyty wykonują regularne kontrole w celu zapewnienia ochrony danych .';
