$_MODULE['<{paytpv}prestashop>paytpv-account_d009bf54f459a2a9c1e516ae765ab0fd'] = 'PAYCOMET również podlega corocznej kontroli przez normy bezpieczeństwa danych ( PCI DSS) w sektorze kart płatniczych i jest dostawcą usług płatniczych Poziom 1 w pełni zatwierdzony, który jest najwyższym poziomem zgodności . ';
