$_MODULE['<{paytpv}prestashop>paytpv-account_2bf0c149d1690aa41a2179a597588b69'] = 'PAYCOMET jest poddane kontroli w środowiskach produkcyjnych.  CPD gdzie funkcjonują systemy, działają zgodnie z wymaganiami centrów Tier III. To gwarantuje, że bezpieczeństwo nie jest zagrożone w dowolnym momencie. Posiada zaawansowane systemy alarmowe, nadzór przez obwód zamknięty strażników TV, agentów ochrony obecnych 24 godziny na dobę i 7 dni w tygodniu w lokalach jak również rygorystyczny nadzór i konserwację.  Wszystkie informacje na temat transakcji i właściciela karta są zabezpieczone nawet  przez własnych pracowników .';
